import React from 'react';
import './App.css';
import { Button } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <h1>Hello world</h1>
      <Button className='btn btn-primary'>aaa</Button>
      <nav class="navbar navbar-expand-sm navbar-light bg-light fixed-top border-bottom clearfix shadow-sm p-3 mb-5 bg-white rounded">
            <div class="container pt-2">
                <a class="navbar-brand align-middle" href="Server.php">Server</a>
                <button class="navbar-toggler" data-toggle="collapse" data-target="#navbarNav">
                <span class="navbar-toggler-icon"></span></button>

                <div class="collapse navbar-collapse" id="navbarNav">

                    <div class="ml-auto">
                        <input type="text" class="form-control search" id="search" placeholder="Search" style={{borderRadius:20}}/>
                    </div>

                    <button class="btn btn-primary ml-auto" data-toggle='modal' data-target='#Upload'>Upload</button>

                </div>
            </div>
      </nav>
      <div className='body'>


      </div>
    </div>
  );
}

export default App;
